import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Row } from "react-bootstrap";
import { listCategories } from "../../../Redux/Action/CategoryAction";
import Loader from "../../Shared/Loader";
import Message from "../../Shared/Message";
import { Link } from "react-router-dom";
import Search from "../../Layout/Search";
import { Route } from "react-router-dom";

const Category = () => {
  const dispatch = useDispatch();
  const [cate, setCate] = useState(false);
  const CategoryList = useSelector((state) => state.CategoryList);
  const { loading, error, categories } = CategoryList;

  useEffect(() => {
    dispatch(listCategories());
  }, [dispatch]);

  // console.log(cate);
  const openCategory = () => {
    setCate(!cate);
  };
  if (cate === true) {
    var as = { display: "none" };
  } else {
    as = { display: "block" };
  }

  const loadProducts = (id) => {
    console.log(id);
  };
  return (
    <div>
      <section className="hero" style={{ paddingTop: "40px" }}>
        <div className="container">
          <div className="row">
            <div className="col-lg-2">
              <div className="hero__categories">
                <div className="hero__categories__all">
                  <i className="fa fa-bars" onClick={() => openCategory()} />

                  <span>Categories</span>
                </div>
                {loading ? (
                  <Loader />
                ) : error ? (
                  <Message variant="danger">{error}</Message>
                ) : (
                  <Row className="sideNavContent" style={as}>
                    <div
                      style={{
                        height: "437px",
                        overflow: "auto",
                        background: "#f3f3f3",
                        scrollBehavior: "smooth",
                        color: "black",
                        fontWeight: "600",
                      }}
                    >
                      <ul>
                        {categories.map((category, index) => (
                          <li
                            key={index}
                            className="mb-2"
                            onClick={() => loadProducts(category._id)}
                          >
                            <Link
                              to={`/products/${category._id}`}
                              style={{
                                cursor: "pointer",
                                listStyle: "none",
                                textDecoration: "none",
                              }}
                            >
                              {category.title}
                            </Link>
                          </li>
                        ))}
                      </ul>
                    </div>
                  </Row>
                )}
              </div>
            </div>

            <div className="col-lg-10">
              <div className="hero__search">
                <div className="hero__search__form ml-6">
                  <Route
                    render={({ history }) => <Search history={history} />}
                  />
                </div>

                <div className="hero__search__phone">
                  <div className="hero__search__phone__icon">
                    <i className="fa fa-phone" />
                  </div>
                  <div className="hero__search__phone__text">
                    <h5>(+91)989-989-9898</h5>
                    <span>support 24/7 time</span>
                  </div>
                </div>
              </div>

              <div
                className="hero__item set-bg"
                style={{
                  backgroundImage: `url("img/hero/banner.jpg")`,
                  backgroundRepeat: "no-repeat",
                  color: "#fff",
                }}
              >
                <div className="hero__text">
                  <span >FRUIT FRESH</span>
                  <h2 style={{ color: "orange" }}>
                    Vegetable <br />
                    100% Organic
                  </h2>
                  <p style={{ color: "orange" }}>
                    Free Pickup and Delivery Available
                  </p>
                  <Link
                    to="/products"
                    className="primary-btn"
                    style={{ color: "black", textDecoration: "none" }}
                  >
                    SHOP NOW
                  </Link>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Category;
